import SearchIcon from '@mui/icons-material/Search';
import { TextField, Stack, Container } from '@mui/material';
import { MarkerMap } from '../../components/map/map';
import './styles.css';

export function PickUp() {
    return(
        <div className="content">
            <Container>
                <Stack
                    direction="row"
                    justifyContent="center"
                    alignItems="center"
                    spacing={2}
                >
                    <SearchIcon/>
                    <TextField className="search" label="Donde te recojo?" variant="filled" />
                </Stack>
            </Container>
            <MarkerMap/>
            <Stack
                    direction="row"
                    justifyContent="center"
                    alignItems="center"
                    spacing={2}
                >
                <label>Hora de recogida:</label>
                <input type="time" id="timePicker" name="time" required/>
            </Stack>
            <button className="confirm">Pedir servicio</button>
        </div>
    );
}
